syntax = "proto3";
import "JAIAMJEOAGD.proto";
import "KAHNKMNMPFM.proto";
message FungusTrainingProgressDetail {
	uint32 dungeon_id = 5;
	repeated uint32 OEEPKBHILJJ = 8;
	repeated JAIAMJEOAGD OAHJFEMKJIG = 2;
	uint32 total_used_time = 10;
	repeated uint32 DGKKMBCNHHG = 3;
	uint32 cur_round = 15;
	repeated KAHNKMNMPFM LKBMMNKHILP = 6;
}
